    <div className='UserCard'>
      <img src={user.avatar_url} alt="userAvatar" className='userAvatar'/>
      <br/>
      <div className="name">
      <h2>{user.name}</h2>
      <h3>{user.login}</h3>
      </div>
      <p cla>logo followers: <span>{user.followers}</span> . following: <span>{user.following}</span></p>
    </div>
  )
}

